import template from './app.html'
import bookList from "../bookList/bookList";
import mainNav from "../mainNav/mainNav";
import bookEdit from "../bookEdit/bookEdit";
import authorEdit from "../authorEdit/authorEdit";
import authorList from "../authorList/authorList";
import storageService from "../../services/storageService";

/* @ngInject*/
class AppCtrl {
    constructor(storageService) {
        const sampleAuthor = {
            name: 'Александр',
            last_name: 'Пушкин'
        };
        const sampleBook = {
            id: 1,
            title: 'Все сказки Пушкина',
            pages: 144,
            authors: [sampleAuthor],
            year: 'Mon Nov 13 2013 00:00:00 GMT+0300',
            isbn: '978-5-373-03958-1',
            publish_year: 2013,
            publisher: 'Просвещение',
            image: 'data:image/jpeg;base64,'
        };
        if (!storageService.get('book') && !storageService.get('author')) {
            storageService.put('book', [sampleBook]);
            storageService.put('author', [sampleAuthor]);
        }
    }
}

const appName = 'app';
const app = angular.module(appName, [
    'ui.router',
    bookList.name,
    mainNav.name,
    bookEdit.name,
    authorEdit.name,
    authorList.name,
    'ngSanitize',
    storageService.name])
    .config(/*@ngInject*/($urlRouterProvider) => {
        $urlRouterProvider.otherwise('/bookList');
    })
    .component(appName, {
        templateUrl: template,
        controller: AppCtrl
    });
export default app;